pragma solidity ^0.8.0;

contract Insurance {

    address payable public insurer;
    address payable public insured;
    uint public premium;
    uint public payout;
    uint public expiration;

    constructor(address payable _insured, uint _premium, uint _expiration) payable {
        insurer = payable(msg.sender);
        insured = _insured;
        premium = _premium;
        expiration = _expiration;
    }

    function purchaseInsurance() public payable {
        require(msg.sender == insured, "Only the insured can purchase this insurance.");
        require(msg.value == premium, "The premium amount must be paid in full.");
        payout = msg.value;
    }

    function claimInsurance() public {
        require(msg.sender == insured, "Only the insured can claim this insurance.");
        require(block.timestamp < expiration, "This insurance has expired.");
        require(payout > 0, "No payout is available for this insurance.");
        insured.transfer(payout);
        payout = 0;
    }

    function cancelInsurance() public {
        require(msg.sender == insurer, "Only the insurer can cancel this insurance.");
        require(block.timestamp < expiration, "This insurance has expired.");
        insured.transfer(premium);
        selfdestruct(insurer);
    }

}
